export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},Qu4Q56BcBx:{data:{id:1602,attributes:{imdbId:"tt0910905",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTU4MTEwMTI4MV5BMl5BanBnXkFtZTcwNDEyNzMzMg@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.1\u002F10"},{Source:"Rotten Tomatoes",Value:"58%"}],item_lang:{data:{id:2265,attributes:{title:"In the Electric Mist",plot:"Lt. Dave Robicheaux, a detective in New Iberia, Louisiana, is trying to link the murder of a local hooker to New Orleans mobster Julie (Baby Feet) Balboni, who is co-producer of a Civil War film. At the same time, after Elrod Sykes, the star of the film, reports finding another corpse in the Atchafalaya Swamp near the movie set, Robicheaux starts another investigation, believing the corpse to be the remains of a black man who he saw being murdered 35 years before.",slug:"in-the-electric-mist"}}},books:{data:[{id:8323,attributes:{title:h,description:i,thumbnail:j,authors:[a],firstBook:true,published:k,publisher:c,subtitle:e}},{id:8324,attributes:{title:h,description:i,thumbnail:j,authors:[a],firstBook:d,published:k,publisher:c,subtitle:e}},{id:8325,attributes:{title:"Three Great Novels",description:"A MORNING FOR FLAMINGOS A routine assignment transporting two death-row prisoners to their execution goes fatally wrong, leaving Dave Robicheaux brutally wounded and his partner dead. Obsessed with revenge, Dave is persuaded by the DEA to go undercover into the torrid depths of New Orleans. He becomes irrevocably caught up in the nightmarish web surrounding Mafia don Tony Cardo and must pit himself against his own worst fears in order to survive. A STAINED WHITE RADIANCE A bullet shot through the window of Weldon Sonnier's house propels Dave Robicheaux back into the lives of a family he's not sure he wants to be reacquainted with. Weldon Sonnier's CIA-influenced past has led to dangerous connections. As Weldon puts himself in the line of fire, Lyle Sonnier, television evangelist and faith healer, reveals to Dave a violent family history that intersects menacingly with Dave's own. IN THE ELECTRIC MIST WITH CONFEDERATE DEAD When a movie crew arrives in New Iberia to shoot a Civil War epic, Dave Robicheaux finds that it's not just the bayou's living inhabitants that are being disturbed. As he hunts a sadistic killer targeting young prostitutes, evidence of an earlier murder is brought to light. The skeletal remains are the last echo of a crime Robicheaux himself witnessed almost forty years ago.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-YuoNwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2005-01-01",publisher:e,subtitle:"A Morning for Flamingos; A Stained White Radiance; In the Electric Mist with Confederate Dead"}},{id:8326,attributes:{title:"The Glass Rainbow",description:"Returning to his Louisiana hometown to investigate a murder, detective Dave Robicheaux finds his skills pushed to their limits when his best friend is accused and his daughter becomes involved in shady business dealings. By the best-selling author of Rain Gods. Reprint. A best-selling novel.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YQO9ZaizNKYC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2011-07-26",publisher:c,subtitle:l}},{id:8327,attributes:{title:"Pegasus Descending",description:"New Orleans detective Dave Robicheaux finds his peaceful life shattered by the appearance of a woman who is passing stolen money and the suicide of another woman who may be the daughter of Dave's long-time friend.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9mdZ8C3GLHYC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2007-08-28",publisher:c,subtitle:l}}]}}},meta:{}}},prerenderedAt:1681377317990}}("James Lee Burke","movie","Simon and Schuster",null,"","series",1,"In the Electric Mist with Confederate Dead","The sixth in the New York Times bestselling Dave Robicheaux series delivers a heart-pounding bayou manhunt—and features “one of the coolest, earthiest heroes in thrillerdom” (Entertainment Weekly ). When Hollywood invades New Iberia Parish to film a Civil War epic, restless specters waiting in the shadows for Louisiana detective Dave Robicheaux are reawakened—ghosts of a history best left undisturbed. Hunting a serial killer preying on the lawless young, Robicheaux comes face-to-face with the elusive guardians of his darkest torments— who hold the key to his ultimate salvation or a final, fatal downfall.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=B2F8AgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2014-01-27","A Dave Robicheaux Novel"))